import React from 'react';
import { Jumbotron, Button, Media } from 'reactstrap';

const JumboCard = (props) => {
  return (
    <div style={{textAlign: "center"}}>
      <div className="jumboContainer" style={{display: "inline-block", background: "white", borderStyle: "inset"}}>
          <div>
              <div>
              <img src="/Temasek.jpg" alt="my image" style={{width: "100%", padding: "2rem", borderRadius: "2.5rem"}}/>
                 <h1 className="display-3" style={{fontSize: "2rem", fontWeight: "600", paddingTop:"2rem"}}><a  style={{textDecoration: "none", color:"black"}} href="https://www.temasek.com.sg/en/index">Temasek Holdings</a></h1>
                 <p className="lead" style={{fontSize: "1rem",fontWeight: "400"}} >Incoming Software Engineering Intern</p>
                 <hr className="my-2" />
                 <p>Part of the Temasek Digital Team</p>
                 <p className="lead">
                </p>
              </div>
          </div>
        <style jsx>{`
           @media (max-width: 500px) {
                    .jumboContainer {
                    width: 90vw;
                    background: red;
                    }
                }
            @media (min-width: 500px) {
                .jumboContainer {
                width: 60vw;
                background: red;
                }
            }
        `} </style>
      </div>
    </div>
  );
};

export default JumboCard;
